def python_add_text(img, layer, text, textType):

	l = pdb.gimp_layer_new(img, img.width, img.height, 1, "Text", 100, 0)
	l.visible = False
	img.add_layer(l, 0)

	region = l.get_pixel_rgn(0, 0, l.width, l.height, True)
	totalOffset = 0
	#Note that Orange text j goes below the char in front. It is treated as a special case here.
	#Similarly, Orange f goes above the char after by one pixel.
	#Lowest Orange goes is 24, City size is 18

	d = textTypeDict[textType]

	for c in text:
		(offset, data) = d['arr'][c]()
		if data != None:
			region[totalOffset:totalOffset+offset,:d['height']] = data
			if textType == 1:
				if c == 'f' or c == 'j':
					offset -= 1
		totalOffset += offset

	l.visible = True

	pdb.python_layerfx_drop_shadow(img, l, (0, 0, 0), 100, 0, 0, 0, 100, 0, 135, 1, True, False)
